  false,\n\t\"url\": null,\n\t\"notes\": \"Brand Label and Wholesale Information for
  Alcohol Products Registered in NYS.The New York State Alcohol Beverage Control Law
  specifies that no manufacturer or wholesaler shall sell to any retailer nor shall
  any retailer purchase any alcoholic beverages unless these beverages are labeled
  in accordance with the Authority's Rules and Federal Regulations and unless such
  label shall be registered with and approved by the State Liquor Authority. Effective
  January 1, 1994, wine does not need to be brand label registered if the wine has
  received label approval from the Bureau of Alcohol, Tobacco and Firearms (BATF).\",\n\t\"license_title\":
